const LOADING = "LOADING";
const ERROR = "ERROR";
const SUCCESS = "SUCCESS";
const GET = "GET";
const POST = "POST";
const UPDATE = "UPDATE";
const DELETE = "DELETE";
const LOGIN = "LOGIN";
const LOGOUT = "LOGOUT";

const actionTypes = {
  LOADING,
  ERROR,
  SUCCESS,
  GET,
  POST,
  LOGIN,
  LOGOUT,
  UPDATE,
  DELETE,
};

export default actionTypes;
